import { Link } from "react-router-dom";

const Home = () => (
  <>
    <div className="home-page">
      <h1>Enjoy kub pom</h1>
      <p>
        Delicious Food, Exellent Service,
        <br />
        Stunning Views!
      </p>
      <Link to="/reservation">Reservation HERE</Link>
    </div>
  </>
);

export default Home;
